import React,{Component} from 'react';
import EmployeeMaster from '../Schema/employee_master';
import Form from 'react-jsonschema-form';
import API from 'axios';
import emplSchema from '../Schema/emplSchema';
import parser from 'json-schema-parser'

const UiSchema = { }

const schema = parser.parse(this.props.employeeMasterSchema).properties.EmployeeMasterPersonal

export default class EmployeePersonalDetails extends Component{
    render() {
        return(
            <div>
                <Form schema= {schema} uiSchema={UiSchema}/>
            </div>
        )
    }
}
